export const handleSearch = (req, res) => {
  const request = require('request');
  let content;

  const CLIENT_ID = 'xCvrl_U0lyrQtQ0oKAoP';
  const CLIENT_SECRET = 'OZ4wI3tMMQ';

  const option = {
    query: req.query.term, //ì´ë¯¸ì§€ ê²€ìƒ‰ í…ìŠ¤íŠ¸
    display: 3, //ê°€ì ¸ì˜¬ ì´ë¯¸ì§€ ê°¯ìˆ˜
  };

  request.get(
    {
      uri: 'https://openapi.naver.com/v1/search/movie.json',
      qs: option,
      headers: {
        'X-Naver-Client-Id': CLIENT_ID,
        'X-Naver-Client-Secret': CLIENT_SECRET,
      },
    },
    function (err, res, body) {
      content = JSON.parse(body); //jsonìœ¼ë¡œ íŒŒì‹±
      if (content.total == 0) {
        redirectHome();
      } else {
        render(body);
      }
    }
  );

  function redirectHome() {
    res.render('home');
  }

  function render(data) {
    data = JSON.parse(data);
    res.render('search', {
      title: `${data.items[0].title.replace('<b>', '').replace('</b>', '')}`,
